import React from 'react'

function App() {
  const [obj, setObj] = useState(
    { 
      name : 'eunji',
      job : 'onehundredwater'
    }
  )

  return (
    <div>
    <div>{obj.name}</div>
    <button onClick={()=>setObj(obj.name='juhyeun')}></button>
    </div>
  )
}

export default App
